import React from 'react'

function CommentsList(props) {
    console.log(props);
    return (
        <div>
            <ul id="commentlist" className= "commentlist"> 
                 {props.students.map(function (student) {
                    // console.log(student);
                    return (
                        <li>
                        {student.name} {student.grade}
                        </li>
                    );
                    })}                         
            </ul> 
        </div>
    )
}

export default CommentsList
